import logo from './logo512.png';
import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { Router } from 'express';
import Login from 'c'

function App() {
  return (
    <>
      <Router>
        <Routes>

          {/* login */}
          <Route
            exact
            path='/'
            element={<login/>}
          />

          {/* home */}

        </Routes>
      </Router>
    </>
  );
}

export default App;
